import React from 'react';
import {Card} from 'antd';
import Avatar from 'antd/lib/avatar/avatar';

const UserProfile= ()=>{
  return(
    <Card
      actions={[
          <div key="twit">0</div>,
          <div key="followings">팔로잉</div>,
          <div key="followers">팔로워</div>
      ]}
    >
        <Card.Meta
         avatar={<Avatar>BY</Avatar>}
         title="bomyi"
        />
        <Button>로그아웃</Button>
    </Card>
  );
};

export default UserProfile;
